  const dispatch = useDispatch();
  const r = acctionPost.getPost.getPostSuccess(data);
  dispatch(r);
  const r1 = useSelector(state=>state.post);
  console.log(r1);
  return (
    <div>
      nguyen quang hoang
    </div>
  );
}

export default App;
